import React from 'react';
import './index.css';


function Cards(props) {
    console.log(props)
    return (

        <div >
            <div className="netflixcontainer">
               
            <img src={props.imgsrc} alt="Netflix Properties"/>
            <h3>{props.sname}</h3>
            </div>
        </div>
    );
}

export default Cards;
